import React from 'react';
import './BestSales.css';
import brownSuitMini from '../assets/images/woman-brown-suit-mini.jpg';
import starRating from '../assets/images/star-rating.png';

class ProductBestSales extends React.Component {
	constructor(){
		super();
		this.state = {
			bestsale: {
				brand: 'reebok',
				name: 'track jacket',
				price: 100
			}
		}
	}
	render(){
		let name = `${this.state.bestsale.brand} ${this.state.bestsale.name}`;
		return (
			<div className="bestsales-item">
				<div className="bestsales-item-picture">
					<img src={brownSuitMini} alt="brown-suit-mini"/>
				</div>
				<div className="bestsales-item-info">
					<h3>{name}</h3>
					<div className="bestsales-item-info-rateprice">
						<img src={starRating} alt="star-rating"/>
						<span>100$</span>
					</div>	
				</div>
			</div>
		)
	}
}

export default ProductBestSales;
